drop database newspaper;
create database newspaper;
use newspaper;

create table users(
    id int primary key auto_increment,
    name varchar(99),
	username varchar(99),
	password varchar(99),
	email varchar(99),
    imgURL text,
	tagline text,
	author int,
    registerDate datetime
);

create table articles(
    id int primary key auto_increment,
    title varchar(99),
	text text,
	tags text,
	imgURL text,
    date datetime,
    likes int,
    idAuthor int,
    foreign key (idAuthor) references users(id)
);

create table comments(
    id int primary key auto_increment,
    text text,
	date datetime,
    likes int,
	idAuthor int,
    idArticle int,
    foreign key (idAuthor) references users(id),
    foreign key (idArticle) references articles(id)
);



